import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header">
      <img src="JSA Logo.png" alt="Japanese Student Association Logo" style={{ maxWidth: '100px', maxHeight: '50px', marginRight: '1000px' }} />
       <h1>Japanese Student Association</h1>
        </header>
    </div>
  );
}

export default App;
